import axios from 'axios'
import React, { useEffect,useState } from 'react'

const AllProducts = () => {
    const [data, setData] = useState([]);
    async function getallpro() {
        try {
          let res = await axios.get("http://127.0.0.1:1214/api/products/users");
            setData(res.data.users)
        } catch (error) {
          console.log(error);
        }
      }
      useEffect(() => {
        getallpro();
      }, []);
  return (
    <>
       
      <table cellPadding={10} className="table table-hover container mt-5 ">
        <tr>
          
          <th>Name</th>
          <th>Price</th>
          <th>Category</th>
          <th>Instock</th>
        </tr>
       {data.length ==0 ? (<h1>No record found</h1>) : ( 
      <table cellPadding={10} className="table table-hover container mt-5 ">
        <tr>
          
          <th>Name</th>
          <th>Email</th>
          <th>Password</th>
          <th>Address</th>
          <th>Phone</th>
          <th>Action</th>
        </tr>
        
      </table>
  )}
      </table>
  
    </>
  )
}

export default AllProducts
